The graph of $y=ax^2$ for $x\geq a$ is a parabola that opens upward, and the graph of $y=ax+2a$ for $x<a$ is a line with slope $a$ and $y$-intercept $2a$.  The graph of $y=f(x)$ is shown below for $a=1$.

[asy]
Label f;

f.p=fontsize(6);

xaxis(-3,5,Ticks(f, 1.0));

yaxis(-1,10,Ticks(f, 1.0));

real f(real x)

{

if (x >= 1)

return (x^2);

else

return (x + 2);

}

draw(graph(f,-2.8,4.8),linewidth(1));
[/asy]

The graph of $y=f(x)$ intersects every horizontal line at least once if and only if the parabola and the line intersect at the point $(a, a^2)$, which means that $a^2=3a$.  The solutions to this equation are $a=0$ and $a=3$.  The largest of these solutions is $\boxed{3}$.

The area of triangle $OAB$ is half the area of parallelogram $OACB,$ where $C$ is the point such that $\overrightarrow{OC} = \begin{pmatrix} -4 \\ -4 \\ 4 \end{pmatrix}.$  (Note that $\overrightarrow{OC} = \overrightarrow{OA} + \overrightarrow{OB}.$)

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (1,2);
B = (-3,-2);
O = (0,0);
C = A + B;

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw(A--B--C--cycle,red+1.5*Arrow(6));

label("$\mathbf{a}$", A, N);
label("$\mathbf{b}$", B, S);
label("$\mathbf{c}$", C, SE);
label("$\mathbf{0}$", O, SW);
[/asy]

The area of parallelogram $OACB$ is
\[\|\overrightarrow{OA} \times \overrightarrow{OB}\| = \left\| \begin{pmatrix} 1 \\ 2 \\ 3 \end{pmatrix} \times \begin{pmatrix} -3 \\ -2 \\ 1 \end{pmatrix} \right\| = \left\| \begin{pmatrix} 8 \\ -10 \\ 4 \end{pmatrix} \right\| = 6 \sqrt{5}.\]Therefore, the area of triangle $OAB$ is $\boxed{3 \sqrt{5}}.$

Since $G$ is the centroid of triangle $ABC$, we have $AG:GD = 2:1$.  Since $MN$ is parallel to $BC$, we have $AG:GN = 2:1$.  Therefore, $GN = \frac{1}{3} AG$.

[asy]
unitsize(0.2 cm);

pair A, B, C, D, E, F, G, M, N;

A = (0,0);
B = (12,0);
C = (4,8);
D = (B + C)/2;
E = (A + C)/2;
F = (A + B)/2;
G = (A + B + C)/3;
M = (2*A + B)/3;
N = (2*A + C)/3;

draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);
draw(G--N);
draw(M--N);

label("$A$", A, SW);
label("$B$", B, SE);
label("$C$", C, NW);
label("$D$", D, NE);
label("$E$", E, NW);
label("$F$", F, SW);
label("$G$", G, NE);
label("$M$", M, NE);
label("$N$", N, NW);
[/asy]

Since $GN = \frac{1}{3} AG$, we have $[ENG] = \frac{1}{3} [AEN]$.  Since $N$ is the midpoint of $AC$, we have $[AEN] = \frac{1}{2} [ABC]$.  Therefore, $[ENG] = \frac{1}{3} \cdot \frac{1}{2} [ABC] = \frac{1}{6} [ABC] = \frac{1}{6} \cdot 144 = \boxed{24}$.

The radical conjugate of $5+\sqrt{3}$ is $5-\sqrt{3}$.  Their product is \begin{align*}
(5+\sqrt{3})(5-\sqrt{3})&=5^2-(\sqrt{3})^2\\
&=25-3\\
&=\boxed{22}.
\end{align*}

We can factor the difference of squares as follows: \begin{align*}
513^2 - 487^2 &= (513+487)(513-487)\\
&= 1000 \cdot 26\\
&= \boxed{26000}.
\end{align*}

Let $\angle CAM = \angle CMA = \alpha.$  Then $\angle BAC = 2 \alpha,$ and $\angle BDC = 6 \alpha.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(Circle(D,1.5));

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

Since $\angle BDC = 6 \alpha,$
\[\angle BDA = 180^\circ - 6 \alpha.\]Since $\angle BDA + \angle BAD = 90^\circ,$
\[\angle BAD = 90^\circ - (180^\circ - 6 \alpha) = 6 \alpha - 90^\circ.\]Since $\angle BAD = 2 \alpha,$
\[2 \alpha = 6 \alpha - 90^\circ.\]Then $\alpha = 15^\circ,$ so $\angle BAC = 30^\circ.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(Circle(D,1.5));
draw(rightanglemark(A,D,M,2));

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

Since $\angle BAC = 30^\circ,$ $BC = 2AB.$  Let $AB = x.$  Then $BC = 2x.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);
draw(Circle(D,1.5));
draw(rightanglemark(A,D,M,2));
draw(rightanglemark(B,D,M,2));

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
label("$x$", (A + B)/2, NW);
label("$2x$", (B + C)/2, NE);
label("$11$", (A + M)/2, W);
label("$11$", (M + D)/2, W);
label("$11$", (D + C)/2, E);
[/asy]

By the Pythagorean Theorem on triangle $ABM,$
\[x^2 + 11^2 = 11^2,\]so $x = 11 \sqrt{3}.$  Then $BC = 2x = 22 \sqrt{3},$ so the perimeter of triangle $ABC$ is $AB + AC + BC = 11 \sqrt{3} + 11 \sqrt{3} + 22 \sqrt{3} = \boxed{44 \sqrt{3}}.$

Let $E$ and $F$ be the midpoints of $\overline{AB}$ and $\overline{AD}$, respectively.  Then $O$ is the intersection of $\overline{EF}$ and $\overline{AC}$, and $O$ is the center of the rectangle $EFGH$ shown below.

[asy]
size(200);
pair A,B,C,D,E,F,G,H,O;
A=(-250,100); B=(250,100); C=(250,-100); D=(-250,-100); E=(-125,100); F=(-250,50); G=(-125,-100); H=(50,-100); O=(0,0);
draw(A--B--C--D--cycle);
draw(E--F--G--H--cycle);
draw(O--E,red);
draw(O--F,red);
label("$A$",A,NW);
label("$B$",B,NE);
label("$C$",C,SE);
label("$D$",D,SW);
label("$E$",E,N);
label("$F$",F,W);
label("$G$",G,S);
label("$H$",H,E);
label("$O$",O,NE);
[/asy]

Let $P$ be a point in the interior of rectangle $EFGH$ such that $OP < PE$ and $OP < PF$.  Then $OP < PF$ implies that $P$ is closer to $F$ than to $A$ or $D$.  Similarly, $OP < PE$ implies that $P$ is closer to $E$ than to $A$ or $B$.  Therefore, $P$ is closer to $O$ than to any of the four vertices of rectangle $ABCD$.

Conversely, if $P$ is closer to $O$ than to any of the four vertices of rectangle $ABCD$, then $P$ is closer to $E$ than to $A$ or $B$, and $P$ is closer to $F$ than to $A$ or $D$.  Therefore, $P$ is in the interior of rectangle $EFGH$.

Thus, the probability that a randomly chosen point in the interior of rectangle $ABCD$ is closer to $O$ than to any of the four vertices is the ratio of the area of rectangle $EFGH$ to the area of rectangle $ABCD$.  Since $AB/AD=k$, the ratio of the areas is $EF/AD = (AD/2)/AD = \boxed{\frac{1}{2}}$.
